import React from 'react';
import { useState } from 'react';

function WeightExercise(props) {
    const {name, img} = props.se
    return (
        <div>
             <h1>{name}</h1>
      <img src={img[0].name} alt={img[0].altText}></img>
        </div>
    );
}

export default WeightExercise;
